import logo from './logo.svg';
import React, {Fragment, PureComponent}from 'react';
import './App.css';
import './settingsPage';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Link to = "/">
          <img src = {require('./pics/greenSETTINGS.png')} className="settings-icon" height={50} width={50}/>
        </Link>

        <p>In Development</p>

      </header>


    </div>
  );
}

export default App;
